from itertools import groupby
def ok(n):
  runlens = [len(list(g)) for k, g in groupby(bin(n)[2:])]
  return all(runlens.count(k) == k for k in range(1, max(runlens)+1))
def aupto(limit): return [m for m in range(1, limit+1) if ok(m)]
